    console.log('clicked')
  }

  render() {
    return (
    <Container>
      <div>
        {this.state.trips.map(trip => (
          <Example

            tripName={trip.tripName}
            image={trip.image}
            destination={trip.destination}
            description={trip.description}
          />
        ))}
      </div>
    </Container>  
    );
  } 
}
